    data: |
      SELECT DISTINCT col0 + - 62 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NULL NOT BETWEEN - 52 - - 78 + col2 * + + 79 AND CAST ( NULL AS INTEGER );
  - name: tab2

outputs:
  - name: q8755.out
    data: |
